import foot from './foot.png';
import olympic from './olympic.png';

let image = false;
const Change = () => {
    if(image===false) {
        image = !image;
        return (
            <p><img src={foot} height="900" width="1200"/></p>
        )
    } else {
        image = !image;
        return (
            <p><img src={olympic} height="900" width="1200"/></p>
        )
    }
};

const Bodies = () => {
    setTimeout(Change, 5000);
};

export default Bodies;
